// src/index.jsx
import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

// load both styles
import './css/base.css';
import './css/classic.css';
import './css/arcade.css';
import './css/cat.css';
import './css/dog.css';

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
